window.bookSummaryJSON = "<p>Annie Mae has one last job to do before she retires from a 30-year career in academia: one week of summer theater camp. A camp she has worked at for so many years, she could do it with her eyes closed. Easy peasy. Until a team leader is murdered and all hell breaks loose, as everyone is a suspect and everyone has a secret. Will she find out the truth before she becomes the killer's next victim? Or will death be her swan song?</p> <p>Find out in book three, <i>Homicide by Hamlet</i>, in the Georgia Coast Cozy Mystery series.</p>"; 
